import { useAuth } from '../context/AuthContext';
import { logout } from '../services/auth';
import { useNavigate } from 'react-router-dom';

export const Header = () => {
  const { currentUser } = useAuth();
  const navigate = useNavigate();

  const handleLogout = async () => {
    await logout();
    navigate('/login');
  };

  return (
    <header style={{
      backgroundColor: 'black',
      color: 'white',
      padding: '1rem',
      textAlign: 'center',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center'
    }}>
      <h1 style={{ margin: 0 }}>Baby Code</h1>
      {currentUser && (
        <button 
          onClick={handleLogout}
          style={{
            backgroundColor: 'black',
            color: 'white',
            border: 'none',
            padding: '2rem 4rem',
            borderRadius: '0px',
            cursor: 'pointer',
            marginLeft: '30px'

          }}
        >
          Logout
        </button>
      )}
    </header>
  );
};
